#
# DP implemented via iteration.
#
from typing import List
from collections import Counter

class Solution:
    def minOperations(self, nums: List[int]) -> int:
        cntr = Counter(nums)
        cnt = 0
        for _, v in cntr.items():
            value = [None for _ in range(v+1)]
            value[0] = 0
            for x in range(1, v+1):
                value[x] = float('inf')
                for n in [2, 3]:
                    if x-n >= 0:
                        value[x] = min(value[x], value[x-n]+1)
            cnt += value[v]
        if cnt == float('inf'):
            return -1
        return cnt

